import * as React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import './App.css';

const initialState = {
    persons: [
      {id: 'as12', name: 'John', age: "27", email: "John@mail.com", pass: "habib27",},
      {id: 'as13', name: 'Bob', age:  "29", email: "bob@mail.com", pass: "bob29",},
      {id: 'as14' ,name: 'Alex', age: "24", email: "alex@mail.com", pass: "alex24",}
    ]
    ,showPersons: false, open: false, isLogin: false,
    emailInput: 'habib', passInput: '', valueOne: '', valueTwo: '',
  }

export class testCode extends React.Component {

    constructor(props) {
        super(props);
        this.state = initialState;
        this.handleChange = this.handleChange.bind(this);
        this.onClick = this.onClick.bind(this);
    }

    render() {
        return (
            <div className="testDiv">
                <TextField
                    name="firstname"
                    value={this.state.firstname}
                    label="First Name"
                    onChange={this.handleChange}/>

                <Button onClick={this.onClick} >Submit</Button>/>
            </div>
        );
    }

    onClick = () => {
        console.log(this.state.firstname);
      }

    handleChange = (ep) => {
      this.setState({firstname: ep.target.value });
    }

}
export default testCode;
